  [],\n\t\"num_tags\": 0,\n\t\"name\": \"pressure-gauge-and-ctd-data-from-ice-islands-and-other-platforms-from-the-beaufort-and-chukchi-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Pressure gauge and CTD data were collected
  from the ICE ISLANDS and other platforms in the Beaufort and Chukchi Seas from 25
  July 1982 to 08 March 1984. Data were collected by the Science Applications, Inc.
  - Raleigh NC (SAI) in support of the Outer Continental Shelf Environmental Assessment
  Program (OCSEAP). Data were processed by NODC to the NODC standard F022 High-Resolution
  CTD/STD Output Format and the F017 Pressure Gauge Format. Full format and format
  code descriptions are available at http://www.nodc.noaa.gov/General/NODC-datafmts.html.nnThe
  F022 format contains high-resolution data collected using CTD (conductivity-temperature-depth)
  and STD (salinity-temperature-depth) instruments. As they are lowered and raised
  in the oceans, these electronic devices provide nearly continuous profiles of temperature,
  salinity, and other parameters. Data values may be subject to averaging or filtering
  or obtained by interpolation and may be reported at depth intervals as fine as 1m.
  Cruise and instrument information, position, date, time and sampling interval are
  reported for each station. Environmental data at the time of the cast (meteorological
  and sea surface conditions) may also be reported. The data record comprises values
  of temperature, salinity or conductivity, density (computed sigma-t), and possibly
  dissolved oxygen or transmissivity at specified depth or pressure levels. Data may
  be reported at either equally or unequally spaced depth or pressure intervals. A
  text record is available for comments.nnThe F017 format contains time series measurements
  of seawater pressure from anchored or bottom-mounted sensors. Measurements of variations
  at depth of seawater pressure provide information on tidal and storm flows, ocean
  circulation, and other phenomena that cause changes in sea surface elevation or
  slope and that can be detected from their pressure signature. Position, bottom depth,
  and gauge depth are reported for each station. The data record comprises values
  of total pressure at specified date and time. Data values may be subject to averaging
  or filtering and are typically reported at time intervals of 10-15 minutes. Seawater
  temperature may also be reported. Comments may be reported in a text record.\",\n\t\"owner_org\":
